INSERT INTO `` (`deptCode`,`courseNum`,`PredeptCode`,`PrecourseNum`,`Prereqtext`,`isconcurrent`) VALUES ('GREN',5236,'SPAM',0,' The course provides an overview of recent literature and debates concerned with the relationships between migration and development. Migration and development are related issues. On the one hand, development is a determinant of migration. International differentials in development, mainly economic (labor-, income- and capital-related), but also political (state- and society-related), will be reviewed. These elements apply at the sending end as push factors (underemployment and unemployment; poverty; poor access to welfare; low rewards to skills; poor governance, political or civil instability, etc.) and at the receiving end as pull factors (jobs availability; higher incomes; social security; higher education; networks of previous migrants; etc.). On the other hand, migration has an impact on development. International mobility of workers and their family members can work for, or against, development. Debates on the impact of development include the following:',0);
