INSERT INTO `` (`deptCode`,`courseNum`,`PredeptCode`,`PrecourseNum`,`Prereqtext`,`isconcurrent`) VALUES ('PPAD',5155,'SPAM',0,' The course explores the evolving status of developing countries in the multilateral system. Are developing countries having a role that allows them to promote their legitimate interests in global international governance and the multilateral trading system? Does International Cooperation work in their favor? Going through the different development paradigms in the UN system, post WW II Bretton Wood system, the course investigates how developing countries remain sidelined from global governance and continue to be mere standard takers.',0);
